import React from 'react';
import * as firebase from 'firebase';

import './App.css';
import Navbar from './components/nav/nav.js'; 
import MainSplash from './components/splasher/main-splash.js'; 
import About from './components/about/about.js'; 

function App() {
  return (
    <div className="App">
      <Navbar />
      <MainSplash />
      <About />
    </div>
  );
}

export default App;
